import '../styles/styles.css';

const Container =(props)=> {

  if (!data || data.length < 0) {
      return "No Images Available"
  }


  return (
    <div className="container">

            {data.map((card)=> {
            <Card 
              key = {card.id}
              data = {card} />
            })}

    </div>
  );
}

export default Container;
